import "../style/sidebar.css";

import React from 'react';
import {Link} from 'react-router-dom';

import Container from 'react-bootstrap/Container';

const Navbar = () => (
    <>
            <Container id = "nav" className = "side-nav border-bottom-sidebar" fluid = {false}>
                    <Link className="nav-custom" to="/engineering">Engineering</Link>
                    <Link className="nav-custom" to="/design">Design</Link>
            </Container>
    </>
);

export default Navbar;
